# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.Forms.Field~Subclass
    - markdownx
    - Member[fields].Member[MarkdownxFormField]
  - - Django.Forms.Field~Subclass
    - markdownx
    - Member[models].Member[MarkdownxFormField]
  - - Django.Views.View~Subclass
    - markdownx
    - Member[urls].Member[ImageUploadView]
  - - Django.Views.View~Subclass
    - markdownx
    - Member[urls].Member[MarkdownifyView]
  - - Django.Views.View~Subclass
    - markdownx
    - Member[views].Member[BaseFormView]
  - - Django.Views.View~Subclass
    - markdownx
    - Member[views].Member[ImageUploadView]
  - - Django.Views.View~Subclass
    - markdownx
    - Member[views].Member[MarkdownifyView]
  - - Django.Views.View~Subclass
    - markdownx
    - Member[views].Member[View]
  - - django.forms.BaseForm~Subclass
    - markdownx
    - Member[forms].Member[ImageForm]
  - - django.forms.BaseForm~Subclass
    - markdownx
    - Member[views].Member[ImageForm]
  - - django.http.response.HttpResponse~Subclass
    - markdownx
    - Member[views].Member[HttpResponse]
  - - django.http.response.JsonResponse~Subclass
    - markdownx
    - Member[views].Member[JsonResponse]
  - - io.StringIO~Subclass
    - markdownx
    - Member[forms].Member[BytesIO]
